function useCount() {
const [value,setValue] = useState(0)
  const [count, setCount] = useState(0);
  const add = () => setCount(count + 1); 
  const input =<input value={value} onChange={e=> setValue(e.target.value)}/>

  return [count, add];

}
export default useCount;
